        <MostPicked
          refMostPicked={this.refMostPicked}
          data={landingPage.mostPicked}
        />
        <Categories data={landingPage.categories}></Categories>
        <Testimonial data={landingPage.testimonial} />
        <Footer></Footer>
      </>
    );
  }
}



export default connect(mapStateToProps, {})(LandingPage)
